#####################################################################
#   Printer Settings
#####################################################################

[include mainsail.cfg]
[include sensorless.cfg]
[include macros.cfg]
[include LED_Settings.cfg]
[include bedfans.cfg]
[include timelapse.cfg]
[include toolhead.cfg]

[force_move]
enable_force_move: True
[input_shaper]
[virtual_sdcard]
path: ~/printer_data/gcodes
[display_status]
[pause_resume]
[exclude_object]
[gcode_arcs]
#resolution: 1.0

[respond]
default_type: echo

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_140025001250335331383820-if00
restart_method: command

[printer]
kinematics: corexy
max_velocity: 300  
max_accel: 3500             #Max 4000
max_z_velocity: 15          #Original was 15, then 30
max_z_accel: 350            #Original was like 400,600 okay, but just check the LDO Standard Config
square_corner_velocity: 5.0

[idle_timeout]
timeout: 3600

#####################################################################
#   Skew Correction
#####################################################################

[skew_correction]
[skew_correction califlower]
xy_skew = 0.00029983510840882947
xz_skew = 0.0
yz_skew = 0.0

[skew_correction califlowerpla]
xy_skew = 0.00029983510840882947
xz_skew = 0.0
yz_skew = 0.0

[skew_correction CaliFlowerPLA]
xy_skew = 0.00029983510840882947
xz_skew = 0.0
yz_skew = 0.0
 
[skew_correction califlowerabs]
xy_skew = -0.00040233380421856793
xz_skew = 0.0
yz_skew = 0.0

[skew_correction CaliFlowerABS]
xy_skew = -0.00040233380421856793
xz_skew = 0.0
yz_skew = 0.0

[skew_correction CaliFlowerASA]
xy_skew = 0.0026138584980829826
xz_skew = 0.0
yz_skew = 0.0

[skew_correction califlowerasa]
xy_skew = 0.0026138584980829826
xz_skew = 0.0
yz_skew = 0.0

#####################################################################
#   Cartographer
#####################################################################

[mcu scanner]
canbus_uuid: a6b561d55dbe

[scanner]
mcu: scanner            
#   Offsets are measured from the centre of your coil, to the tip of your nozzle 
#   on a level axis. It is vital that this is accurate. 
x_offset: 0                          
#    adjust for your cartographers offset from nozzle to middle of coil
y_offset: 23                         
#    adjust for your cartographers offset from nozzle to middle of coil
backlash_comp: 0.00587
#   Backlash compensation distance for removing Z backlash before measuring
#   the sensor response.
sensor: cartographer
#    this must be set as cartographer unless using IDM etc.
sensor_alt: carto
#    alternate name to call commands. CARTO_TOUCH etc      
mesh_runs: 2
#    Number of passes to make during mesh scan.

[bed_mesh]
zero_reference_position: 175, 175    
#    set this to the middle of your bed
speed: 200
#    movement speed of toolhead during bed mesh
horizontal_move_z: 5
#    height of scanner during bed mesh scan
mesh_min: 30,30 #10,10
#    start point of bed mesh [X, Y]
mesh_max: 320, 320 #340,340
#    end point of bed mesh [X, Y]
probe_count: 30, 30
algorithm: bicubic

#[safe_z_home]
#home_xy_position:175,175
#speed:100
#z_hop:10
#z_hop_speed:10

[quad_gantry_level]
speed: 200
gantry_corners:
   -60,-10
   410,420
#  Probe points
points:
   25,15
   25,300
   325,300
   325,15
#horizontal_move_z: 2
retries: 5  
retry_tolerance: 0.01

#####################################################################
#   X/Y Stepper Settings
#####################################################################

##  B Stepper - Left
##  Connected to MOTOR_0
##  Endstop connected to DIAG_0
[stepper_x]
step_pin: PF13
dir_pin: PF12
enable_pin: !PF14
rotation_distance: 40
microsteps: 32
full_steps_per_rotation:400  #set to 200 for 1.8 degree stepper
endstop_pin: tmc2209_stepper_x:virtual_endstop
#endstop_pin: PG6 #when not using sensorless homing
position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 20   #Max 100
homing_retract_dist: 0 #old value was 5
homing_positive_dir: true

##  Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_x]
uart_pin: PC4
diag_pin: ^PG6 # use the same pin that was previously the endstop_pin!
driver_SGTHRS: 94 # 255 is most sensitive value, 0 is least sensitive
interpolate: false
run_current: 0.8
sense_resistor: 0.110
stealthchop_threshold: 0

##  A Stepper - Right
##  Connected to MOTOR_1
##  Endstop connected to DIAG_1
[stepper_y]
step_pin: PG0
dir_pin: PG1
enable_pin: !PF15
rotation_distance: 40
microsteps: 32
full_steps_per_rotation:400  #set to 200 for 1.8 degree stepper
#endstop_pin: tmc2209_stepper_y:virtual_endstop
endstop_pin: PG9
position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 20  #Max 100
homing_retract_dist: 0 #old value was 5
homing_positive_dir: true

##  Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_y]
uart_pin: PD11
diag_pin: ^PG9 # use the same pin that was previously the endstop_pin!
#driver_SGTHRS: 88 # 255 is most sensitive value, 0 is least sensitive #WAS 88
interpolate: false
run_current: 0.8
sense_resistor: 0.110
stealthchop_threshold: 0
 
#####################################################################
#   Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left
##  Connected to MOTOR_2
##  Endstop connected to DIAG_2
[stepper_z]
step_pin: PF11
dir_pin: PG3
enable_pin: !PG5
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32
endstop_pin: probe:z_virtual_endstop
##  Z-position of nozzle (in mm) to z-endstop trigger point relative to print surface (Z0)
##  (+) value = endstop above Z0, (-) value = endstop below
##  Increasing position_endstop brings nozzle closer to the bed
##  After you run Z_ENDSTOP_CALIBRATE, position_endstop will be stored at the very end of your config
#position_endstop: 5 # cartographer needs this to be commented out
position_max: 345
position_min: -10
homing_speed: 8
second_homing_speed: 3
homing_retract_dist: 0

##  Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z]
uart_pin: PC6
interpolate: false
run_current: 0.9 #0.8
sense_resistor: 0.110
stealthchop_threshold: 999999

##  Z1 Stepper - Rear Left
##  Connected to MOTOR_3
[stepper_z1]
step_pin: PG4
dir_pin: !PC1
enable_pin: !PA0
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

##  Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z1]
uart_pin: PC7
interpolate: false
run_current: 0.9
sense_resistor: 0.110
stealthchop_threshold: 999999

##  Z2 Stepper - Rear Right
##  Connected to MOTOR_4
[stepper_z2]
step_pin: PF9
dir_pin: PF10
enable_pin: !PG2
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

##  Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z2]
uart_pin: PF2
interpolate: false
run_current: 0.9
sense_resistor: 0.110
stealthchop_threshold: 999999

##  Z3 Stepper - Front Right
##  Connected to MOTOR_5
[stepper_z3]
step_pin: PC13
dir_pin: !PF0
enable_pin: !PF1
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

##  Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z3]
uart_pin: PE4
interpolate: false
run_current: 0.9
sense_resistor: 0.110
stealthchop_threshold: 999999

#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
heater_pin: PA2
#sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_type: Generic 3950
sensor_pin: PF3
max_power: 0.7
min_temp: 0
max_temp: 120

[verify_heater heater_bed]
max_error: 120
check_gain_time: 80
hysteresis: 5
heating_gain: 2

#####################################################################
#   Fan Control
#####################################################################

[fan_generic Electronics_fan]
pin: PD15
kick_start_time: 2.0
max_power: 1.0
shutdown_speed: 1.0 # Blast the fan if an error is triggered
hardware_pwm: True
cycle_time: 0.00004 # 25 kHz
tachometer_pin: ^PG11
tachometer_ppr: 2

[fan_generic Octopus_Fan]
pin: PA8
kick_start_time: 2.0
max_power: 1.0
shutdown_speed: 1.0 # Blast the fan if an error is triggered

#####################################################################
#   Additional Sensors
#####################################################################

[temperature_sensor chamber]
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: PF5
min_temp: 0
max_temp: 100
gcode_id: chamber_th

[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[temperature_sensor Octopus]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

[temperature_sensor EBB36]
sensor_type: temperature_mcu
sensor_mcu: Toolhead
min_temp: 0
max_temp: 100

[temperature_sensor Cartographer_MCU]
sensor_type: temperature_mcu
sensor_mcu: scanner
min_temp: 0
max_temp: 105

########################################
# WLED
########################################

[gcode_macro WLED_ON]
description: Turn WLED strip on using optional preset and resets led colors
gcode:
  {% set strip = params.STRIP|default("chamber")|string %}
  {% set preset = params.PRESET|default(1)|int %}

  {action_call_remote_method("set_wled_state",
                             strip=strip,
                             state=True,
                             preset=preset)}

[delayed_gcode setchamberled]
initial_duration: 2
gcode:
  WLED_ON STRIP=chamber PRESET=1

[delayed_gcode turnonelectronicsfan]
initial_duration: 1
gcode:
  SET_FAN_SPEED FAN=Electronics_fan SPEED=1

